public boolean canClose()
{
    boolean ret;

    ret = super();

    if (ret && this.closedOk())
    {
        ret = element.validate();

        if (ret)
        {
            caller.parmFromDateTime(fromDateTime.dateTimeValue());
            caller.parmToDateTime(toDateTime.dateTimeValue());
            caller.parmRealizedInvoices(realizedInvoices.value());
            caller.parmTmpExportOrderTable(eximDEPBExportOrderTable);
            caller.parmTmpExportOrderLine(eximDEPBExportOrderLine);
        }
    }

    return ret;
}

public void init()
{
    super();
    eximAuthorizationArgs = element.args();
    caller = eximAuthorizationArgs.caller();

    if (!caller)
    {
        throw error("@SYS22539");
    }

    caller.getExportedOrderDetails(caller.parmSchemeTableRecId());
    eximDEPBExportOrderTable.setTmpData(caller.parmTmpExportOrderTable());
    eximDEPBExportOrderLine.setTmpData(caller.parmTmpExportOrderLine());

    fromDateTime.dateTimeValue(caller.parmFromDateTime());
    toDateTime.dateTimeValue(caller.parmToDateTime());

    realizedInvoices.value(NoYes::Yes);
    if (fromDateTime.dateTimeValue())
    {
        realizedInvoices.value(caller.parmRealizedInvoices());
    }
}

public void showData()
{
    if (this.validate())
    {
        caller.showData(eximAuthorizationArgs,
                        fromDateTime.dateTimeValue(),
                        toDateTime.dateTimeValue(),
                        realizedInvoices.value());

        eximDEPBExportOrderTable.setTmpData(caller.parmTmpExportOrderTable());
        eximDEPBExportOrderLine.setTmpData(caller.parmTmpExportOrderLine());
        eximDEPBExportOrderTable_ds.research();
        eximDEPBExportOrderLine_ds.research();
    }
}

public boolean validate()
{
    boolean isParmValid = true;
    ;

    if (!fromDateTime.dateTimeValue() || !toDateTime.dateTimeValue())
    {
        isParmValid = checkFailed("@SYS39609");
    }
    else if (fromDateTime.dateTimeValue() > toDateTime.dateTimeValue())
    {
        isParmValid = checkFailed("@SYS103965");
    }

    return isParmValid;
}

public void init()
{
    super();

    this.cacheCalculateMethod(tablemethodstr(TmpEximDEPBExportOrderLine_IN, itemName));
    this.cacheCalculateMethod(tablemethodstr(TmpEximDEPBExportOrderLine_IN, billOfLadingNumber));
    this.cacheCalculateMethod(tablemethodstr(TmpEximDEPBExportOrderLine_IN, shippingBillQty));
    this.cacheCalculateMethod(tablemethodstr(TmpEximDEPBExportOrderLine_IN, displayExportDateTime));
}

void clicked()
{
    EximBankCertificate_IN    eximBankCertificate;
    ;

    super();
    eximBankCertificate = new EximBankCertificate_IN();
    eximBankCertificate.parmEximDEPBExportOrderTable(eximDEPBExportOrderTable);
    eximBankCertificate.parmEximDEPBExportOrderLine(eximDEPBExportOrderLine);
    eximBankCertificate.parmExportOrderTableRecId(eximDEPBExportOrderLine.ExportOrderTableRecId);

    if (eximBankCertificate.prompt())
    {
        eximBankCertificate.runOperation();
        eximDEPBExportOrderTable.setTmpData(eximBankCertificate.parmEximDEPBExportOrderTable());
        eximDEPBExportOrderLine.setTmpData(eximBankCertificate.parmEximDEPBExportOrderLine());
        eximDEPBExportOrderTable_ds.research();
        eximDEPBExportOrderLine_ds.research();
    }
}
